import React, { useState, useEffect } from "react";
import Content from "../../components/Content";
import PacienteService from "../../services/PacienteServices";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import Layout from "../../containers/Layout";
import RadioGroup from '@mui/material/RadioGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormLabel from '@mui/material/FormLabel';

// LIBRERIAS FORMULARIOS
import {
  FormControl,
  InputLabel,
  TextField,
  MenuItem,
  Select,
  Button,
} from "@mui/material";



const PacientesAdd = () => {
  const [nomPaciente, setnomPaciente] = useState("");
  const [ap1Paciente, setap1Paciente] = useState("");
  const [ap2Paciente, setap2Paciente] = useState("");
  const [edadPaciente, setedadPaciente] = useState("");
  const [sexoPaciente, setsexoPaciente] = useState("");
  const [psicologo, setPsicologo] = useState("");
  const [psicologos, setPsicologos] = useState([]);

  const navigate = useNavigate();

  const server = "http://localhost:4002";

  const getData = async () => {
    const { data } = await axios.get(`${server}/psicologos`);
    console.log(data);
    setPsicologos(data);
  };

  useEffect(() => {
    getData();
  }, []);

  const handlePaciente = (event) => {
    setnomPaciente(event.target.value);
  };
  const handleap1Paciente = (event) => {
    setap1Paciente(event.target.value);
  };
  const handleap2Paciente = (event) => {
    setap2Paciente(event.target.value);
  };
  const handleedadPaciente = (event) => {
    setedadPaciente(event.target.value);
  };
  const handlesexoPaciente = (event) => {
    setsexoPaciente(event.target.value);
  };
  const handlePsicologo = (event) => {
    setPsicologo(event.target.value);
  };
  const handlePsicologos = (event) => {
    setPsicologos(event.target.value);
  };

  const Cancelar = () => {
    navigate("/");
  };

  const handleSubmit = () => {
    let paciente = {
      nomPaciente: nomPaciente,
      ap1Paciente: ap1Paciente,
      ap2Paciente: ap2Paciente,
      edadPaciente: edadPaciente,
      sexoPaciente: sexoPaciente,
      idPsicolgo: parseInt(psicologo),
    };
    
    console.log(paciente);

    try{
      PacienteService.createPaciente(paciente);
    }
    catch (error){
      console.error("Error al actualizar el Paciente:", error);
    }
    
    navigate("/");
  };

  return (
    <Layout>
      <Content>
        <h1>AÑADIR PACIENTE</h1>
          <form>
            <div>
            <select
                  class="caja"
                  labelId="psicologo"
                  id="psicologo"
                  name="psicologo"
                  onChange={handlePsicologo}
                >
                  <option disabled selected>
                    Eligir psicologo
                  </option>
                    {psicologos.map((psicologo) => (
                  <option value={psicologo.idPsicolgo}>
                    {psicologo.nomPsicolgo} {psicologo.ap1Psicolgo} {psicologo.ap2Psicolgo}
                  </option>
                  ))}
                </select>
            </div>
            <label for="nombre">Nombre</label>
	          <input type="text" name="nombre" id="nombre" onChange={handlePaciente} placeholder="Escribe tu nombre"/>
            <label for="apellidoP">A. Paterno</label>
	          <input type="text" name="apellidoP" id="apellidoP" onChange={handleap1Paciente} placeholder="1er Apellido"/>
            <label for="apellidoM">A. Materno</label>
	          <input type="text" name="apellidoM" id="apellidoM" onChange={handleap2Paciente} placeholder="2do Apellido"/>
            <label for="edad">Edad</label>
	          <input type="text" name="edad" id="edad" onChange={handleedadPaciente} placeholder="Edad"/>
            <label for="sexo">Sexo</label>
            
            <FormLabel id="demo-row-radio-buttons-group-label" style={{ color: 'white', fontFamily: "Roboto-Medium", fontSize: 15, fontWeight: 600 }}>Sexo:</FormLabel>
                                    <RadioGroup
                                        row
                                        aria-labelledby="demo-radio-buttons-group-label"
                                        value={sexo}
                                        onChange={handleSexo}
                                        name="radio-buttons-group"
                                    >
                                        <FormControlLabel value="M" className="lblRadio" control={<Radio sx={{
                                            color: "white",
                                            '&.Mui-checked': {
                                                color: "white",
                                            },
                                        }} />} label="Masculino" style={{ color: 'white' }} />
                                        <FormControlLabel value="F" className="lblRadio" control={<Radio sx={{
                                            color: "white",
                                            '&.Mui-checked': {
                                                color: "white",
                                            },
                                        }} />} label="Femenino" style={{ color: 'white' }} />
                                    </RadioGroup>





            <div>
              <p>
                <input type="submit" name="registrar" value="Registrar" onChange={handleSubmit}/>
                <input type="submit" name="cancelar" value="Cancelar" onChange={Cancelar}/>
              </p>
            </div>
          </form>
      </Content>
    </Layout>
  );
};

export default PacientesAdd;
